import React from "react";
import iconFacebook from '../images/icon-facebook.svg';
import iconInstagram from '../images/icon-instagram.svg';
import iconTwitter from '../images/icon-twitter.svg';
import iconYoutube from '../images/icon-youtube.svg';
import iconUp from '../images/icon-up.svg';
import iconDown from '../images/icon-down.svg';
import { unstable_renderSubtreeIntoContainer } from "react-dom";

function MainCard(props) {
    const mediaName = props.mediaName;

    const img = () => {
        if (mediaName === "facebook")
            return iconFacebook;
        else if (mediaName === "instagram")
            return iconInstagram;
        else if (mediaName === "twitter")
            return iconTwitter;
        else if (mediaName === "youtube")
            return iconYoutube;
    };

    return (<div class="card big fb">
        <img src={img} alt={mediaName + '-img'} />{props.id}
        <h1>{props.followers}</h1>
        <span class="unit">Followers</span>
        <div><img src="../../images/icon-up.svg" />{props.upDownNum} Today</div>
    </div>);
}

export default MainCard;
